import React from "react";
import Header from "../common/Header";

const CoursesPage = () => {
  return (
    <>
      <Header pageTitle={"Courses Page"} />
      <div>
        <h1>Courses Page</h1>
        {/* Content for Courses Page */}
      </div>
    </>
  );
};

export default CoursesPage;
